s.aP(0,"Dual Effect Removal",new A.b43(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/effects/dual_effect_removal_example.dart","    In this example we show how a dual effect can be used and removed.\n    To remove an effect, tap anywhere on the screen and the first tap will\n    remove the OpacityEffect and the second tap removes the ColorEffect.\n    In this example, when an effect is removed the component is reset to\n    the state (the part of the state that was affected by the running effect)\n    that it had before the effect started running.\n  ")
s.aP(0,"Rotate Effect",new A.b44(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/effects/rotate_effect_example.dart",'    The outer rim rotates at a different speed forward and reverse, and\n    uses the "ease" animation curve.\n\n    The compass arrow has 3 rotation effects applied to it at the same\n    time: one effect rotates the arrow at a constant speed, and two more\n    add small amounts of wobble, creating quasi-chaotic movement.\n  ')
s.aP(0,"Size Effect",new A.b45(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/effects/size_effect_example.dart","    The `SizeEffect` changes the size of the component, the sizes of the\n    children will stay the same.\n    In this example you can tap the screen and the component will size up or\n    down, depending on its current state.\n  ")
s.aP(0,"Scale Effect",new A.b46(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/effects/scale_effect_example.dart","    In this example you can tap the screen and the component will scale up or\n    down, depending on its current state.\n    \n    The star pulsates randomly using a RandomEffectController.\n  ")
s.aP(0,"Opacity Effect",new A.b47(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/effects/opacity_effect_example.dart","    In this example we show how the `OpacityEffect` can be used in two ways.\n    The left Ember will constantly pulse in and out of opacity and the right\n    flame will change opacity when you click the screen.\n  ")
s.aP(0,"Color Effect",new A.b48(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/effects/color_effect_example.dart","    In this example we show how the `ColorEffect` can be used.\n    Ember will constantly pulse in and out of a blue color.\n  ")
s.aP(0,"Sequence Effect",new A.b49(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/effects/sequence_effect_example.dart","    Sequence of effects, consisting of a move effect, a rotate effect, another\n    move effect, a scale effect, and then one more move effect. The sequence\n    then runs in the opposite order (alternate = true) and loops infinitely\n    (infinite = true).\n  ")
